import {Header} from './component/header'
import {TopImage} from './component/top-image'
import {MainPage} from './component/mainpage'
import {Router,Route,IndexRoute,hashHistory, Routes, BrowserRouter} from 'react-router';
import {Link} from 'react-dom'
import { useState } from 'react';

function App() {
  return (
    <div className="App" id="App">
      <Header/>
      <TopImage />
      <MainPage />
      <Link to="/invoices">Invoices</Link>
      <Link to="/expenses">Expenses</Link>
      {/* <Home /> */}
    </div>
  );
}

function Home () {
  return (
    <BrowserRouter>
        <Routes>
          <Route path='/' element={Story}></Route>
          <Route path='/1' element={Story1}></Route>
        </Routes>
    </BrowserRouter>
  )
}

function Story () {
  return (
    <div>
      456
    </div>
  )
}

function Story1 () {
  return (
    <div>
      789
    </div>
  )
}

export default App;
